import React, { Component } from 'react';
import axios from 'axios';
import NavbarHeader from './navbarhead';
import Timeslots from './Timeslots';
import './App.css';
class App extends Component {

  constructor(props) {
    super(props);

    this.state = {
      list: []
    }
  }

  componentDidMount() {
    this.getList();
  }

  getList = () => {
    fetch('http://localhost:4000/purchase')
    .then(res => res.json())
    .then(list => this.setState({ list }))
  }


  render() {
    const { list } = this.state; 
    return (
        <div className="App">
          <NavbarHeader />
          <Timeslots />
          <div>
            {JSON.stringify( list )}
          </div>

        </div>
    )
  }
}

export default App;
